import React from "react";
import "./Top.css";

const Top = props => {

  return (
    <div className="App">
      <div className="main-wrapper">
        <div className="top_track_name">
            {"Top Track: "} {props.top_track_items[0].name}
        </div>
        <div className="top_track_artist">
            {"Artist: "} {props.top_track_items[0].name}
        </div>
      </div>
    </div>
  );
}

export default Top;
